import React, { Component } from 'react';
import ReactCardCarousel from 'react-card-carousel';
import noProfileImg from '../../assets/noProfileImg.png';

export default class TeamCarsouel extends Component {
    
    static get CONTAINER_STYLE() {
        return {
          position: "relative",
          height: "100vh",
          width: "100%",
          display: "flex",
          flex: 1,
          justifyContent: "center",
          alignItems: "middle"
        };
      }

    static get CARD_STYLE() {
        return {
          height: '200px',
          width: '200px',
          paddingTop: '80px',
          textAlign: 'center',
          background: '#52C0F5',
          color: '#FFF',
          fontSize: '12px',
          textTransform: 'uppercase',
          borderRadius: '10px',
        };
      }

    render() {
        return (
            <div style={TeamCarsouel.CONTAINER_STYLE}>
                <ReactCardCarousel autoplay={ true } autoplay_speed={ 3500 }>
                    <div style={ TeamCarsouel.CARD_STYLE }>
                      <div className="card">
                        <div className="card__header">
                        <img src={noProfileImg} alt="" />
                        </div>
                        <div className="card__body">
                          <h4>Bander AlRasheed</h4>
                        </div>
                        <div className="footer">
                          Vice-President
                        </div>
                      </div>
                    </div>
                    <div style={ TeamCarsouel.CARD_STYLE }>
                    Second Card
                    </div>
                    <div style={ TeamCarsouel.CARD_STYLE }>
                    Third Card
                    </div>
                    <div style={ TeamCarsouel.CARD_STYLE }>
                    Fourth Card
                    </div>
                    <div style={ TeamCarsouel.CARD_STYLE }>
                    Fifth Card
                    </div>
                </ReactCardCarousel>
            </div>
        )
    }
}
